-- ----------------------------
DROP TABLE IF EXISTS `ksys_service_controller`;
CREATE TABLE `ksys_service_controller` (
  `controllerid` varchar(40) NOT NULL COMMENT '控制器ID',
  `modelid` varchar(40) DEFAULT NULL COMMENT '模型ID（交易码、服务FullId）',
  `servicename` varchar(40) DEFAULT NULL COMMENT '模型名称',
  `servicetype` varchar(30) NOT NULL DEFAULT 'TRY_SERVICE' COMMENT '模型类型（tran/try_service/confirm_service/cancel_service）',
  `isregistmessage` char(1) NOT NULL DEFAULT '0' COMMENT '是否登记服务报文',
  `maxruntimeinms` bigint(20) DEFAULT NULL COMMENT '最大运行时间（Server）（毫秒）',
  `isreadisland` char(1) DEFAULT '1' COMMENT '是否只读（Server）（判断当前交易或服务是否只进行读操作）',
  `isrunnable` char(1) DEFAULT '1' COMMENT '是否执行',
  `loglevel` varchar(10) DEFAULT NULL COMMENT '日志级别',
  `propagation` varchar(20) NOT NULL DEFAULT 'NotSupported' COMMENT '主事务传播方式',
  `isregistclientmessage` char(1) NOT NULL DEFAULT '0' COMMENT '是否登记客户端服务报文',
  `isnamemapping` char(1) DEFAULT '0' COMMENT '当外调其它系统的时候是否进行别名映射，默认0-不',
  `iscallbizservice` char(1) DEFAULT '0',
  `timeoutconfirmcount` tinyint(2) DEFAULT '0',
  PRIMARY KEY (`controllerid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

